import React from 'react';
import './App.css';
import Index from './components/Index.js'

function App() {
  return (
    <>
      <h1 className="hellopokemons"><span className="first">"HELLO,</span><span className="second"> POKEMONS"</span></h1><br/><br/><br/><br/><br/>
      <Index />
    </>
  );
}

export default App;
